// VMServiceHandler is an implementation of the limiquantix.compute.v1.VMService service.
type VMServiceHandler interface {
	// CreateVM creates a new virtual machine.
	// The VM will be in STOPPED state after creation unless start_on_create is true.
	CreateVM(context.Context, *connect.Request[v1.CreateVMRequest]) (*connect.Response[v1.VirtualMachine], error)
	// GetVM retrieves a virtual machine by ID.
	GetVM(context.Context, *connect.Request[v1.GetVMRequest]) (*connect.Response[v1.VirtualMachine], error)
	// ListVMs returns a paginated list of virtual machines.
	ListVMs(context.Context, *connect.Request[v1.ListVMsRequest]) (*connect.Response[v1.ListVMsResponse], error)
	// UpdateVM updates a virtual machine's specification.
	// Some changes require the VM to be stopped (e.g., CPU/memory changes).
	UpdateVM(context.Context, *connect.Request[v1.UpdateVMRequest]) (*connect.Response[v1.VirtualMachine], error)
	// DeleteVM permanently deletes a virtual machine.
	// The VM must be stopped first. Use force=true to stop and delete.
	DeleteVM(context.Context, *connect.Request[v1.DeleteVMRequest]) (*connect.Response[emptypb.Empty], error)
	// StartVM powers on a virtual machine.
	StartVM(context.Context, *connect.Request[v1.StartVMRequest]) (*connect.Response[v1.VirtualMachine], error)
	// StopVM powers off a virtual machine.
	// Use force=true for hard power off (like pulling the power cord).
	StopVM(context.Context, *connect.Request[v1.StopVMRequest]) (*connect.Response[v1.VirtualMachine], error)
	// RebootVM restarts a virtual machine.
	RebootVM(context.Context, *connect.Request[v1.RebootVMRequest]) (*connect.Response[v1.VirtualMachine], error)
	// PauseVM suspends VM execution (freezes in place).
	PauseVM(context.Context, *connect.Request[v1.PauseVMRequest]) (*connect.Response[v1.VirtualMachine], error)
	// ResumeVM resumes a paused virtual machine.
	ResumeVM(context.Context, *connect.Request[v1.ResumeVMRequest]) (*connect.Response[v1.VirtualMachine], error)
	// SuspendVM saves VM state to disk and stops (hibernate).
	SuspendVM(context.Context, *connect.Request[v1.SuspendVMRequest]) (*connect.Response[v1.VirtualMachine], error)
	// CreateSnapshot creates a point-in-time snapshot.
	CreateSnapshot(context.Context, *connect.Request[v1.CreateSnapshotRequest]) (*connect.Response[v1.Snapshot], error)
	// ListSnapshots returns all snapshots for a VM.
	ListSnapshots(context.Context, *connect.Request[v1.ListSnapshotsRequest]) (*connect.Response[v1.ListSnapshotsResponse], error)
	// RevertToSnapshot reverts the VM to a previous snapshot.
	RevertToSnapshot(context.Context, *connect.Request[v1.RevertToSnapshotRequest]) (*connect.Response[v1.VirtualMachine], error)
	// DeleteSnapshot removes a snapshot.
	DeleteSnapshot(context.Context, *connect.Request[v1.DeleteSnapshotRequest]) (*connect.Response[emptypb.Empty], error)
	// MigrateVM live-migrates a VM to another node.
	MigrateVM(context.Context, *connect.Request[v1.MigrateVMRequest]) (*connect.Response[v1.MigrateVMResponse], error)
	// GetConsole returns connection info for VNC/SPICE console.
	GetConsole(context.Context, *connect.Request[v1.GetConsoleRequest]) (*connect.Response[v1.ConsoleInfo], error)
	// CloneVM creates a copy of a virtual machine.
	CloneVM(context.Context, *connect.Request[v1.CloneVMRequest]) (*connect.Response[v1.VirtualMachine], error)
	// ConvertToTemplate marks a VM as a template.
	ConvertToTemplate(context.Context, *connect.Request[v1.ConvertToTemplateRequest]) (*connect.Response[v1.VirtualMachine], error)
	// AttachDisk attaches a new disk to a VM (hot-plug if running).
	AttachDisk(context.Context, *connect.Request[v1.AttachDiskRequest]) (*connect.Response[v1.VirtualMachine], error)
	// DetachDisk removes a disk from a VM (hot-unplug if running).
	DetachDisk(context.Context, *connect.Request[v1.DetachDiskRequest]) (*connect.Response[v1.VirtualMachine], error)
	// ResizeDisk expands a disk attached to a VM.
	ResizeDisk(context.Context, *connect.Request[v1.ResizeDiskRequest]) (*connect.Response[v1.VirtualMachine], error)
	// AttachNIC attaches a new network interface to a VM (hot-plug if running).
	AttachNIC(context.Context, *connect.Request[v1.AttachNICRequest]) (*connect.Response[v1.VirtualMachine], error)
	// DetachNIC removes a network interface from a VM (hot-unplug if running).
	DetachNIC(context.Context, *connect.Request[v1.DetachNICRequest]) (*connect.Response[v1.VirtualMachine], error)
	// ListVMEvents returns events for a VM.
	ListVMEvents(context.Context, *connect.Request[v1.ListVMEventsRequest]) (*connect.Response[v1.ListVMEventsResponse], error)
	// WatchVM streams real-time updates for a VM.
	WatchVM(context.Context, *connect.Request[v1.WatchVMRequest], *connect.ServerStream[v1.VirtualMachine]) error
	// StreamMetrics streams real-time performance metrics.
	StreamMetrics(context.Context, *connect.Request[v1.StreamMetricsRequest], *connect.ServerStream[v1.ResourceUsage]) error
	// WatchVMs streams updates for all VMs (for Host UI dashboard).
	WatchVMs(context.Context, *connect.Request[v1.WatchVMsRequest], *connect.ServerStream[v1.VMUpdate]) error
	// PingAgent checks if the guest agent is available and responding.
	PingAgent(context.Context, *connect.Request[v1.PingAgentRequest]) (*connect.Response[v1.PingAgentResponse], error)
	// ExecuteScript runs a command inside the VM via the guest agent.
	ExecuteScript(context.Context, *connect.Request[v1.ExecuteScriptRequest]) (*connect.Response[v1.ExecuteScriptResponse], error)
	// ReadGuestFile reads a file from inside the VM.
	ReadGuestFile(context.Context, *connect.Request[v1.ReadGuestFileRequest]) (*connect.Response[v1.ReadGuestFileResponse], error)
	// WriteGuestFile writes a file to the VM.
	WriteGuestFile(context.Context, *connect.Request[v1.WriteGuestFileRequest]) (*connect.Response[v1.WriteGuestFileResponse], error)
	// GuestShutdown requests the guest agent to gracefully shutdown/reboot.
	GuestShutdown(context.Context, *connect.Request[v1.GuestShutdownRequest]) (*connect.Response[v1.GuestShutdownResponse], error)
}

